import React from 'react';
import ReactDOM from 'react-dom';
import { Link, Route, Switch } from 'react-router-dom';
import './Component/Css/Componentscss.css';
import Navbar from './Component/Navbar/Navbar';
import Frontpage from './Component/Pages/Frontpage';
import Detailspage from './Component/Pages/detailspage';
import Cartpage from './Component/Pages/cartpage';
import Signin from './Component/Pages/signinpage';
import { addToCart, removeFromCart } from '../../Actions/Cartaction';
import { useDispatch, useSelector } from 'react-redux';



function App (props) {

    const userSignin = useSelector(state => state.userSignin)

        return (
            <div>

                <div className='Frontpage grid-container'>
                    <Navbar />

                <Route exact={true} path="/" component={Frontpage} />
                <Route exact={true} path="/products/:id" component={Detailspage} />
                <Route exact={true} path="/cart/:id?" component={Cartpage} />
                <Route exact={true} path="/signin" component={Signin} />
                

                </div>

            </div>
            )
    


}

export default App;
